// 100%, 80%, 50%, Fast charge, Battery Change

var priceList = [
    { name: "Lade til 50%", value: NaN },
    { name: "Lade til 80%", value: NaN },
    { name: "Lade til 100%", value: NaN },
    { name: "Hurtiglading", value: NaN },
    { name: "Batteribytte", value: 2000 }
];

var priceListGlobal = flow.get('priceListGlobal') || {};

// Lagrer variablene til senere, har den ikke fått noe er den lik 0
var pricePerUnit = priceListGlobal.pricePerUnit || 0;
var currentBatteryLevel = priceListGlobal.currentBatteryLevel || 0;

switch (msg.topic) {

    case "pricePerUnit":
        priceListGlobal.pricePerUnit = msg.payload;
        break;

    case "currentBatteryLevel":
        priceListGlobal.currentBatteryLevel = msg.payload;
        break;

    default:
        // Handle unknown topic values here
        break;
}
if (currentBatteryLevel < 50) {  // Pris for 50%
    priceList[0].value = (50 - currentBatteryLevel) * pricePerUnit;
}
if (currentBatteryLevel < 80) {  // Pris for 80%
    priceList[1].value = (80 - currentBatteryLevel) * pricePerUnit;
}
if (currentBatteryLevel < 100) {  // Pris for fullading med/uten hurtiglading
    priceList[2].value = (100 - currentBatteryLevel) * pricePerUnit;
    priceList[3].value = 3 * (100 - currentBatteryLevel) * pricePerUnit;
}
priceList[4].value = 2000;

flow.set('priceListGlobal', priceListGlobal);

return { payload: priceList };

